DROP TABLE IF EXISTS public.register_ip;

create table register_ip (
	id integer ,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	email VARCHAR(50),
	gender VARCHAR(50),
	ip_address VARCHAR(20),
	date DATE
) partition by range (date);


